var toVoidRecod = function (rec) {
    var o = {
	"context" : {
	    "contextActivities" : {
		"parent" : [{
		    "id" : rec.object.id,
		    "objectType" : "Activity"
		}]
	    }
	},
	"actor" : rec.actor,
	"verb": {
	    "display": {
		"en-US": "voided"
	    },
	    "id": "http://adlnet.gov/expapi/verbs/voided"
	},
	"object": {
	    "id": rec.id,
	    "objectType": "StatementRef"
	},
	"stored" : rec.stored,
	"timestamp" : rec.timestamp,
	"id" : "v-" + rec.id
    };

    return o;
};

